import react from "react";
import SearchBar from "./SearchBar.js";

class App extends react.Component {
  state = "";

  render() {
    return (
      <div className="search-bar ui segment">
        <form className="ui form">
          <div className="field">
            <label>Videos search</label>
            <input type="text" />
          </div>
        </form>
      </div>
    );
  }
}

export default App;
